	var countQwizSlides = $('.home-qwiz-slider').slick('getSlick').slideCount - 1;
	var currentQwizSlide = $('.home-qwiz-slider').slick('getSlick').currentSlide;

	function dotsQwizSlider(count, current) {
		var i = 0;

		while( i <= count ) {
			var numberSlide = i + 1;
			var h = '<div data-slide="' + i + '">' + numberSlide + '</div>';

			$('.home-qwiz-slider-dots').append(h);

			if ( i == current ) {
				//$('.home-qwiz-slider-dots > div').removeClass('current');
				$('.home-qwiz-slider-dots > div[data-slide="' + i + '"]').addClass('current');
			}
			i++;
		}
	}
	dotsQwizSlider(countQwizSlides, currentQwizSlide);

	$('.home-qwiz-slider-btns a.btn-next').on('click', function(event) {
		event.preventDefault();

		var next = true;
		var c = $('.home-qwiz-slider').slick('getSlick').currentSlide;

		$('input[data-for-slide="' + c + '"]').each( function() {
			if ( $(this).data('require') == true && $(this).val().length == 0 ) {
				next = false;
			}
		});

		if ( next == true ) {
			$('.home-qwiz-slider').slick('slickNext');
		}
	});

