	//===== Yandex map =====//
	ymaps.ready(init);

	var coordCenterMyMap = [54.86157006982136, 83.11163049999991],
		zoomSize = 'large';

	if ( document.documentElement.clientWidth <= 992 ) {
		coordCenterMyMap = [54.86157006982136, 83.11363049999991];
		zoomSize = 'small';
	}

	function init(){
		var myMap = new ymaps.Map("map", {
			controls: [],
			center: coordCenterMyMap,
			zoom: 17
		});

		var myPlacemark = new ymaps.Placemark([54.86157006982136, 83.11363049999991], {
			hintContent: 'Спецбассейн',
			// balloonContent: 'По адресу'
		}, {
			iconLayout: 'default#image',
			iconImageClipRect: [[0,0], [58, 80]],
			iconImageHref: 'images/marker-map.png',
			iconImageSize: [58, 80],
			iconImageOffset: [-29, -80],
		});

		myMap.geoObjects.add(myPlacemark);
		myMap.behaviors.disable(['scrollZoom']);

		var zoomControl = new ymaps.control.ZoomControl({
			options: {
				size: zoomSize
			}
		});

		myMap.controls.add(zoomControl);
	}

